module.exports = "<section class=\"container-grid\">\r\n  <article class=\"menu-help\">\r\n    <ul class=\"list-help\">\r\n      <li><a class=\"font-Roboto\" target=\"_self\" routerLink=\"#contrato\">Contrato</a></li>\r\n      <li><a class=\"font-Roboto\" target=\"_self\" routerLink=\"#registro\">Registro</a></li>\r\n      <li><a class=\"font-Roboto\" target=\"_self\" routerLink=\"#login\">Login</a></li>\r\n      <li><a class=\"font-Roboto\" target=\"_self\" routerLink=\"#dashboard\">Dashboard</a></li>\r\n    </ul>\r\n  </article>\r\n  <div class=\"articles\">\r\n    <article id=\"contrato\">\r\n      <h2 class=\"font-Roboto\">Contrato</h2>\r\n      <p class=\"font-Roboto\">Para comenzar a disfrutar de nuestros servicios puede enviar sus datos de contacto en el formulario ubicado en el pie de página.\r\n        Ambos campos son obligatorios, para tener un mejor control de sus datos.\r\n      </p>\r\n      <p class=\"font-Roboto\">Una vez que haya enviado sus datos, nuestro equipo de contacto se encargará de comunicarse con usted para los trámites necesarios para la contratación del servicio.</p>\r\n      <img src=\"../../../assets/img/formulario.jpg\" alt=\"formulario\">\r\n    </article>\r\n    <article id=\"registro\">\r\n      <h2 class=\"font-Roboto\">Registro</h2>\r\n      <p class=\"font-Roboto\">Cuando haya realizado en contrato con nuestro equipo, de contacto usted podrá realizar una cuenta, en la que podrá acceder de la siguiente manera.\r\n        Primero de click en la pestaña iniciar sesión, luego vaya a la pestaña registrarse, en la que todos los campos en el formulario son obligatorios.\r\n      </p>\r\n      <img src=\"../../../assets/img/sesion.jpg\" alt=\"inicio-sesion\">\r\n      <img src=\"../../../assets/img/registro.jpg\" alt=\"registro\">\r\n      <p class=\"font-Roboto\">Una vez que haya realizado su registro, será enviado a su correo electrónico un mail de verificación de cuenta para que su usuario sea validado.</p>\r\n    </article>\r\n    <article id=\"login\">\r\n      <h2 class=\"font-Roboto\">Login</h2>\r\n      <p class=\"font-Roboto\">Cuando ya tenga una registrada una cuenta en el sitio web podrá ingresar al sistema de TaxiMex.\r\n        Primero vaya al enlace iniciar sesion.\r\n      </p>\r\n      <img src=\"../../../assets/img/sesion.jpg\" alt=\"inicio-sesion\">\r\n      <p class=\"font-Roboto\">\r\n        Ingrese sus datos y de click al boto ingresar. Una vez ingresado podrá disfrutar de los servicios de TaxiMex.\r\n      </p>\r\n    </article>\r\n    <article id=\"dashboard\">\r\n      <h2 class=\"font-Roboto\">Dashboard</h2>\r\n      <p> class=\"font-Roboto\"Dentro del sistema Taximex podrá encontrar de inmediato las gráficas de su negocio, las cuales al momento de entrar aparecerán vacías.</p>\r\n    </article>\r\n  </div>\r\n</section>"

